package com.lukafurlan.adventofcode2018;

/**
 * @author Luka Furlan <luka.furlan9@gmail.com>
 */
public class Day5 {

    private static final String INPUT = "";

    public static void main(String[] args) {
        System.out.println(processPolymer(INPUT).length());
        System.out.println(optimizePolymer());
    }

    private static String processPolymer(String input) {

        for(int i = 0; i < input.length()-1; i++) {
            if(Character.toLowerCase(input.charAt(i)) == Character.toLowerCase(input.charAt(i+1))
                    && (Character.isUpperCase(input.charAt(i)) && Character.isLowerCase(input.charAt(i+1))
                    || Character.isLowerCase(input.charAt(i)) && Character.isUpperCase(input.charAt(i+1)))) {
                String substring = input.substring(i, i+2);
                input = input.replaceFirst(substring, "");
                return processPolymer(input);
            }
        }

        return input;

    }

    private static int optimizePolymer() {

        int bestPolymer = 0;

        char[] alphabet = {'a','b','c','d','e','f','g','h','i','j','k','l','m','n','o','p','q','r','s','t','u','v','w','x','y','z'};

        String input;

        for(int i = 0; i < alphabet.length; i++) {

            String letter = String.valueOf(alphabet[i]);

            input = INPUT;
            input = input.replace(letter, "");
            input = input.replace(letter.toUpperCase(), "");

            int length = processPolymer(input).length();

            if(length < bestPolymer || bestPolymer == 0) {
                bestPolymer = length;
            }

        }

        return  bestPolymer;
    }

}
